import React from 'react'
import './App.scss';

export default class Article extends React.Component {
    constructor(props) {
        super ( props )
    }

    render() {
        return (<div className={"horizontal-margin-10"}>
            <img src={`/assets/${this.props.img}`}/>
            <h3>{this.props.title}</h3>
            <p>{this.props.text}</p>
        </div>)
    }
}
